(31, 45, '2015-03-26', 'BEAUTY dan HEALTH', 'Herbal', 'Produk Herbal', 'Gamat Gold', 180000, 110000, '<p>JELLY GAMAT GOLD G&nbsp; berupa cairan kental bening seperti jelly, terbuat dari ekstrak teripang laut spesies Golden Stichopus Variegatus yang diolah secara modern melalui 4 kali proses destilasi sehingga Jelly Gamat Gold G&nbsp;ini tidak memiliki rasa dan tidak berbau.</p><p><em>Jelly Gamat Gold G</em>&nbsp;merupakan salah satu suplemen &nbsp;yang direkomendasi oleh para ahli sebagai solusi yang tepat untuk pencegahan maupun obat pendamping untuk memberantas berbagai macam penyakit sampai ke akar-akarnya secara aman tanpa efek samping yang membahayakan tubuh.</p>', 's', 59, '2015-05-26', 'FREE', 'AKTIF', 'gambar/WWW.YOSHSOLO.COM15gold_g-jpeg.jpg', 143, 8, 0, 0, '2015-05-14', 250, '', 0),
(32, 45, '2015-03-27', 'BEAUTY dan HEALTH', 'Herbal', 'Produk Herbal', 'Minyak Lintah Papua', 150000, 120000, '<p>Minyak Lintah</p><p>Sejak jaman dulu&nbsp;<strong>minyak lintah</strong>&nbsp;sudah terkenal khasiatnya bagi kaum Adam, namun hal ini sangat tabu untuk dibicarakan. Khasiat dan manfaatnya yang sangat ampuh untuk membantu kaum pria menambah kepercayaan dirinya sebagai laki-laki. Memang sejak dahulu nenek moyang kita telah menggunakan&nbsp;<em>minyak lintah</em>&nbsp;untuk mengatasi masalah kelelakian. Ramuan ini dirahasiakan dan hanya diwariskan secara turun menurun kepada anak cucu mereka. Seiring perjalanan waktu dan adanya penelitian akhirnya&nbsp;minyak lintah&nbsp;semakin banyak peminatnya bahkan sampai pangsa pasar luar negeri pun banyak yang tertarik.<br />&nbsp;</p>', 's', 150, '2015-03-28', 'PIN', 'AKTIF', 'gambar/WWW.YOSHSOLO.COM16Lintah Papua-228x228.jpg', 168, 16, 10000, 0, '2015-05-14', 250, '', 0),
(33, 105, '2015-04-02', 'BEAUTY dan HEALTH', 'Herbal', 'Produk Herbal', 'Gamat Gold G', 180000, 120000, '<p>JELLY GAMAT GOLD G&nbsp; berupa cairan kental bening seperti jelly, terbuat dari ekstrak teripang laut spesies Golden Stichopus Variegatus yang diolah secara modern melalui 4 kali proses destilasi sehingga Jelly Gamat Gold G&nbsp;ini tidak memiliki rasa dan tidak berbau.</p><p><em>Jelly Gamat Gold G</em>&nbsp;merupakan salah satu suplemen &nbsp;yang direkomendasi oleh para ahli sebagai solusi yang tepat untuk pencegahan maupun obat pendamping untuk memberantas berbagai macam penyakit sampai ke akar-akarnya secara aman tanpa efek samping yang membahayakan tubuh.</p><p>Kandungan Obat Jelly Gamat Gold G</p><p>Jelly gamat Gold G merupakan obat yang 100% halal, terbuat dari ekstrak teripang laut yang merupakan solusi tepat untuk di gunakan sebagai obat, pencegah atau obat pendamping untuk memberantas penyakit.</p><p>Berdasarkan hasil penelitian, di dalam teripang laut ini terkandung <strong>~Protein 86,8%, ~Kolagen 80,0%, ~Mineral, ~Mukopolisakarida, ~Glucasaninoglycans (GAGs), ~Antiseptik alamiah, ~Chondroitin, ~Asam Amino, ~Omega-3, 6, 9 dan ~Gamapeptide</strong> yang bermanfaat untuk mengaktifkan pertumbuhan sel atau mampu meregenerasi sel dengan sangat cepat, sebagai anti inflamasi/peradangan, dapat mengurangi rasa nyeri bahkan di katakan memiliki anti analgesik 3 kali lebih kuat dari pada analgesik (anti nyeri) kimiawi.</p><p>Berbagai Khasiat Jelly Gamat Gold G</p><p>Khasiat&nbsp;<em>Jelly Gamat Gold G&nbsp;</em>diantaranya yaitu untuk membantu dalam pengobatan penyakit atau permasalahan seperti:</p><p>Alergi, Anemia, Asam Urat, &nbsp;Batu Ginjal, Badan Lemah, Darah Rendah, Darah Tinggi, Diabetes, Eksim, Epilepsi, Hepatitis / Liver, Haid Lancar, Jantung, Jerawat, Kanker, Kista, Kolesterol, Luka, Lupus, Maag, Migrain, Nyeri Sendi, Paru-paru, Pendarahan, Perut Kembung, Radang, Sakit Pinggang, Sesak Napas, Stroke, Sinusitis, Thalasemia, TBC, Thypus, Tumor Ovarium, Varises dan penyakit lainnya.</p><p>Keistimewaan Jelly Gamat Gold G</p><ul><li>Jelly Gamat Gold G&nbsp;terbuat dari species teripang terbaik Golden Stichopus Variegatus. Golden Sea Cucumber (gamat emas) adalah salah satu species yang paling bernilai dengan kandungan gizi dan khasiat penyembuhan tertinggi diantara semua species Sea Cucumber.</li><li>Jelly Gamat Gold G diproduksi oleh pabrik farmasi yang sudah berstandar GMP</li><li>Teknologinya telah dibangun lebih dari 15 tahun (dibangun oleh Professor dari Malaya University).</li><li>Jelly Gamat Gold G terdaftar di MAL Malaysia dengan no.registrasi MAL0611420T</li><li>Jelly Gamat Gold G terdaftar juga di Badan POM Indonesia dengan no.registrasi BPOM RI ML234201001307</li><li>Jelly Gamat Gold G memperoleh sertifikat HalalÂ€Â dari Departement of Islamic Development Malaysia (JAKIM) dengan no registrasi JAKIM / (22.00) / 492/2/1.</li><li>Jelly Gamat Gold G telah dipasarkan lebih dari 10 tahun dan telah memiliki banyak testimoni dari konsumen</li><li>Jelly Gamat Gold G&nbsp;memiliki khasiat penyembuhan yang sangat baik dalam membantu penyembuhan berbagai penyakit (tentu disertai dengan pengobatan ke dokter pula).</li><li>Tidak hanya aman dan bergizi, tetapi Jelly Gamat Gold G&nbsp;juga merupakan suplemen kesehatan yang efektif dan ekonomis.</li></ul><p><strong>Jelly Gamat Gold G</strong>&nbsp;adalah satu-satunya produk jeli gamat yang terdaftar di Singapura, sebagai salah satu negara barometer Health Food Asia selain Jepang dan China. Berikut ini legalitas&nbsp;Jelly Gamat Gold G&nbsp;yang sudah di akui oleh beberapa instansi yang berkompeten di berbagai negara :</p><ul><li>Jelly Gamat Gold G&nbsp;telah terdaftar di&nbsp;<strong>BPOM RI TI 11464572.</strong></li><li>Bersertifikat&nbsp;<strong>HALAL</strong>&nbsp;dari Malaysia:&nbsp;<strong>JAKIM (22.00)/492/2/1 010-10/2004.</strong></li><li>Rekomendasi dari Agri-Food &amp;&nbsp;Veterinary Authority of Singapore (AVA) tanggal 11 Oktober 2003&nbsp;(Semacam Departemen Kesehatan-nya Pemerintah Singapura).</li></ul><p>Aturan konsumsi Jelly Gamat Gold G&nbsp; Sea Cucumber</p><p>Aturan konsumsi Jelly Gamat Gold G&nbsp;ini dengan takaran menggunakan sendok makan.</p><ul><li>Untuk menjaga kesehatan, cukup 2-3 sendok makan 1x atau 2x sehari.</li><li>Untuk terapi sakit ringan-sedang, minumlah 3 sendok makan 2x sehari.</li><li>Untuk terapi sakit berat, minumlah 3-4 sendok makan 4x sehari.</li><li>Untuk terapi Darah Tinggi, Athritis, Asam Urat, minumlah 3 sendok makan 3x &ndash; 4x sehari.</li><li>Untuk terapi Diabetes / Kencing Manis, minumlah 4 sendok makan 3x &ndash; 4x sehari.</li><li>Untuk terapi Jantung atau Stroke, minumlah 5-6 sendok makan 4x sehari.</li><li>Untuk terapi Kanker, minumlah 1/4 botol 4x sehari (1 botol dihabiskan untuk 1 hari).</li></ul><p>Agar daya kerjanya lebih cepat, &nbsp;ikuti aturan konsumsi dan tips berikut ini:&nbsp;larutkan satu sendok makan&nbsp;Jelly Gamat Gold G&nbsp;ke dalam 1/2 s.d. 1 gelas air putih hangat (200 ml). Aduk hingga benar-benar larut. Minum larutan tersebut sampai habis. Cara ini lebih dianjurkan untuk penderita stroke, hepatitis, liver dan hipertensi berat.<br />Untuk hasil yang lebih maksimal tambahkan 1 sdm Madu Murni Alami &quot;Adonai Jaya&quot;</p><p>&nbsp;</p>', 'S', 62, '2015-12-31', 'PIN', 'AKTIF', 'gambar/CAHAYA2jelly-gamat-gold-g.jpg', 115, 10, 30, 0, '2015-05-14', 330, '7ORG0YUZK9MLDSHB7FSV', 100),
(34, 45, '2015-04-03', 'BEAUTY dan HEALTH', 'Herbal', 'Produk Herbal', 'Garcium', 65000, 60000, '<p>Garcimun ( Ekstrak Kulit Manggis dan Propolis)<br />Kode: GCM 321<br /><br />Merupakan kapsul herbal yang di ramu dari Kulit Manggis dan Propolis. Perpaduan antara Kulit Manggis dan Propolis tersebut dengan takaran yang tepat sangat bagus untuk membantu meningkatkan daya tahan tubuh, sehingga bisa membantu mencegah serta mengobati berbagai penyakit.<br /><br />Komposisi :<br />- Garcinia Mangostana Fructus Cortex..........................................90%<br />- Propolis ...........................................10%<br /><br />Isi : 60 kapsul @ 500 mg<br /><br />POM TR 133371181<br />Di Produksi Oleh :<br />CV. AGARICUS SIDO MAKMUR SANTOSA<br />Malang - Indonesia<br /><br />Di pasarkan oleh :<br />Herbal Inti Sehat<br />Solo - Indonesia</p>', 's', 262, '2015-04-10', 'FREE', 'AKTIF', 'gambar/WWW.YOSHSOLO.COM17garcimun1a-500x500.jpg', 96, 5, 0, 0, '2015-05-14', 250, '8RAUYJXBKL4Z9MNO1J3E', 0),
