(36, 105, '2015-04-09', 'BEAUTY dan HEALTH', 'Herbal', 'Produk Herbal', 'Syamil Dates Honey', 22000, 17000, '<p><strong>Deskripsi Herbal Madu Syamil</strong></p><p>Madu lengkap buat anak dan balita&nbsp;kita usia 1 dan 2 tahun ke atas,&nbsp;<strong>Syamil Dates Honey</strong>&nbsp;mempunyai khasiat yang lengkap. Toko kami menjual madu syamil, untuk anak agar tumbuh sehat dan otak cerdas.</p><p><strong>Kandungan Syamil Dates Honey</strong></p><p>Madu yang cocok untuk anak usia dini, karena secara komposisi telah diproduksi khusus aman bagi bayi dan balita.&nbsp;Sebagai Madu Lengkap anak cerdas, memiliki komposisi terbaik herbal yaitu madu asli, kurma dan zaitun bahkan propolis. Selain mengandung herbal yang terbukti ampuh,&nbsp;madu buat anak cerdas&nbsp;ini juga memiliki kandungan Curcuma, Vitamin C, Omega 3, 6, dan 9. Komplit...! Madu ini cocok untuk anak usia 2 tahun.<br /><br /><strong>Manfaat Syamil Dates Honey &ndash; Madu buat Anak</strong></p><p>Kami berbisnis jual Madu Anak dan Balita, diantaranya khasiat utama Madu untuk anak-anak ini adalah untuk kecerdasan otak serta pertumbuhan anak, selain itu manfaat madu buat balita ini adalah menjaga ketahanan tubuh,. Manfaat madu Syamil lebih lengkapnya adalah sebagai berikut:</p><ul><li>Berkhasiat sebagai herbal yang meningkatkan nafsu makan anak</li><li>Obat alami untuk meningkatkan pemulihan setelah sakit DBD,</li><li>Madu Syamil&nbsp;membantu menyembuhkan batuk, deman dan pilek pada anak.</li><li>Madu berkualitas karena tanpa bahan pengawet dan diproses dengan ahli yang berpengalaman,</li><li>sangat baik untuk menurunkan demam panas tinggi</li><li>melancarkan pencernaan.</li></ul><p><br /><strong>Detail Info Produk Madu Syamil</strong></p><p>Kode produk:&nbsp;</p><p>HET:Rp 22.000</p><p>Isi:125 ml</p><p>Dosis:2 kali sehari</p><p>Berat:&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;200 gram</p><p>Izin:LP-POM MUI No 00120057620311</p><p>Produsen:Mitra insan sejahtera</p>', 'S', 964, '2015-12-31', 'FREE', 'AKTIF', 'gambar/CAHAYA4madu-syamil.jpg', 60, 2, 0, 0, '2015-05-14', 125, 'Z85RACOFDX02M3THURLW', 0),
(37, 105, '2015-04-09', 'BEAUTY dan HEALTH', 'Herbal', 'Produk Herbal', 'Garcimun', 65000, 60000, '<p>Garcimun ( Ekstrak Kulit Manggis dan Propolis)<br />Kode: GCM 321<br /><br />Merupakan kapsul herbal yang di ramu dari Kulit Manggis dan Propolis. Perpaduan antara Kulit Manggis dan Propolis tersebut dengan takaran yang tepat sangat bagus untuk membantu meningkatkan daya tahan tubuh, sehingga bisa membantu mencegah serta mengobati berbagai penyakit.<br /><br />Komposisi :<br />- Garcinia Mangostana Fructus Cortex..........................................90%<br />- Propolis ...........................................10%<br /><br />Isi : 60 kapsul @ 500 mg<br /><br />POM TR 133371181<br />Di Produksi Oleh :<br />CV. AGARICUS SIDO MAKMUR SANTOSA<br />Malang - Indonesia<br /><br />Di pasarkan oleh :<br />Herbal Inti Sehat<br />Solo - Indonesia</p><p>&nbsp;</p>', 'S', 964, '2015-12-31', 'FREE', 'AKTIF', 'gambar/CAHAYA5garcimun1.jpg', 65, 2, 0, 0, '2015-05-14', 300, '9TB2IKPSQC67DMZ81NAO', 0),
(39, 105, '2015-04-10', 'Lain-lain', 'Lainnya', '--Pilih Sub Dua--', 'Serbuk Intan Cristal', 45000, 30000, '<p>SERBUK INTAN&nbsp;<br />MURAH..TAPI KUALITAS TIDAK MURAHAN!!! Grab fast! Stok terbatas!<br />(Kemasan Baru, Merk Baru, Karat Baru, Hindari Pemalsuan Barang!!!)<br /><br />Serbuk intan murni grade 0,2. tanpa oplosan bahan lain maupun bahan kimia.<br />Berfungsi untuk mengkilatkan batu cincin, batu akik dan permata kesayangan Anda agar terlihat lebih indah dan cantik. Cocok di gunakan untuk kolektor batu cincin. Juga cocok utk mempercepat keluarnya kilauan batu yg baru dibentuk/dibuat (12 carats).<br />Isi Kemasan -/+ 4 gram (lebih awet &amp; hemat).&nbsp;<br />Silahkan Anda bandingkan dgn produk2 lainnya yg sekelas dengan Cristal Gem*.&nbsp;<br /><br />Cara pakai:<br />Taburkan sedikit saja serbuk intan ini ke atas kulit.<br />Agar lebih awet &amp; tidak berceceran saat menggosok, dapat di teteskan sedikit minyak zaitun/minyak kelapa pada kulit, kemudian gosok permukaan batu searah. Gosoklah sampai terlihat langsung perubahannya.</p><p>&nbsp;</p>', 'S', 1000, '2015-12-31', 'FREE', 'AKTIF', 'gambar/CAHAYA6serbuk_cristal.jpg', 67, 1, 25, 0, '2015-05-14', 10, 'NQ30WDSE7K9BRCZFLNY7', 100),
(41, 133, '2015-04-27', 'GADGET dan COMPUTER', 'MOBILE PHONE', '--Pilih Sub Dua--', 'Blackberry z10', 2700000, 2500000, '<p><strong>BlackBerry Z10</strong>&nbsp;adalah sebuah telepon seluler pintar dengan layar sentuh (<em>touchscreen</em>) yang dikeluarkan oleh&nbsp;<a href="http://id.wikipedia.org/wiki/RIM">RIM</a>.<a href="http://id.wikipedia.org/wiki/BlackBerry_Z10#cite_note-namechange1-30-13-5">[5]</a>&nbsp;BlackBerry Z10 secara resmi diluncurkan di Indonesia pada tanggal 4 Maret lalu di Jakarta. BlackBerry Z10 pertama kali dikenalkan pada dunia resminya di akhir bulan Januari 2013.<a href="http://id.wikipedia.org/wiki/BlackBerry_Z10#cite_note-6">[6]</a></p><p>Dari segi tampilan luar, BlackBerry Z10 adalah ponsel yang keseluruhannya berupa layar sentuh.<a href="http://id.wikipedia.org/wiki/BlackBerry_Z10#cite_note-blackberry1-7">[7]</a>&nbsp;Produsen mengeluarkan ponsel ini dengan dua warna, yakni hitam dan putih. BlackBerry Z10 memiliki fitur HDMI out port mikro untuk presentasi, dan sensor canggih seperti NFC (<em><a href="http://id.wikipedia.org/w/index.php?title=Near_Field_Communications&amp;action=edit&amp;redlink=1">Near Field Communications</a></em>) untuk mendukung pembayaran&nbsp;<em>mobile</em>&nbsp;dan pertukaran informasi hanya dengan satu ketukan dari smartphone.</p><p>&nbsp;</p><p>&nbsp;</p>', 'z10', 29, '2015-05-27', 'FREE', 'AKTIF', 'gambar/REVO1bbz10.jpg', 59, 6, 0, 0, '2015-05-14', 200, 'RGO462MJQ5UI1PNLBO6H', 0),
(42, 18, '2015-04-28', 'GADGET dan COMPUTER', 'MOBILE PHONE', 'Tablet', 'ZTE Blade Vec Pro', 2500000, 2200000, '<p>ZTE Blade Vec Pro adalah sebuah ponsel pintar untuk Anda yang membutuhkan hal lebih dari Andoid. Menggunakan prosesor ocra core 1.4 GHz dan RAM 1 GB, ponsel ini dapat digunakan untuk multitasking dan melakukan pekerjaan berat lainnya. Memiliki layar sebesar 5 inchi dengan resolusi 720 x 1280, memory internal 8 GB, dan slot microSD yang mendukung hingga kapasitas 32 GB.</p>', 'gram', 9, '2015-04-30', 'FREE', 'AKTIF', 'gambar/PAKDE2zte.jpg', 27, 1, 0, 0, '2015-05-14', 200, '2T9H83Q754ZLFWMX65FW', 0),
(43, 137, '2015-04-29', 'BEAUTY dan HEALTH', 'Herbal', 'Produk Herbal', 'AURA MAGIC MASK', 35000, 25000, 'AURA MAGIC MASK adalah masker herbal yang diformulasikan sebagai nutrisi dan asupan makanan untuk kulit yang mengandung protein,saponin,mousturizing,vit A,Vit C,Vit D,biotin  dan AHA\r\nYang berfungsi mencegah kulit kering & bersisik,\r\nmelindungi kotoran agar tidak masuk sedangkan yang dibutuhkan kulit tetap meresap kedalam kulit,\r\nmengangkat sel kulit mati,mengencangkan pori2 yg terbuka sehingga kulit tampak halus\r\nmengembalikan warna kulit seperti kulit asli yg kita miliki(kulit yg tdk pernah terkena UV itu adalah warna kulit asli kita)', 'Sachet', 0, '2015-07-29', 'TIDAK AKTIF', 'AKTIF', 'gambar/AURAMILYONER991P_20150411_104421_NT.jpg', 45, 0, 0, 0, '2015-05-14', 45, 'TFVB82AY4G0IH6PJC82Z', 0),
(44, 139, '2015-05-10', 'BEAUTY dan HEALTH', 'Herbal', 'Produk Herbal', 'Vitabumin sahabat bunda mengoptimalkan kembang tum', 70000, 65000, '<p>Madu Albumin Anak &rdquo; Vitabumin&rdquo;<br />Nutrisi TUmbuh kembang anak.</p><p>Usia 1-12 Tahun</p><p>Komposisi :</p><p>Madu<br />Protein Albumin<br />Temulawak<br />Pegagan<br />insyaAllah berkhasiat :</p><p>Memperbaiki dan membangun jaringan tubuh<br />menambah nafsu makan dan meningkatkan daya tahan tubuh<br />meningkatkan kecerdasan<br />Mengandung banyak vitamin dan kaya akan mineral yang sangat di butuhkan anak.<br />Produksi : CV Aksamala Adi Andana</p><p>Din Kes Pirt : 109331300822619</p>', '150 ml', 1000, '2015-06-10', 'FREE', 'AKTIF', 'gambar/AMANAH_2015111208662_697591127019210_1218376763351805911_n.jpg', 14, 0, 0, 0, '2015-05-14', 250, 'ZMK4I53QGVNUD7SBK4PV', 0),
