INSERT INTO `news` (`id`, `judul`, `isi`, `tgl`, `stat`, `lokasi`) VALUES
(1, 'Link Referal Pembeli Get Pembeli', '<p>RejekiMall menyediakan kesempatan bagi Anda untuk mereferensikan saudara/sahabat/teman/relasi Anda untuk menjadi Pembeli di RejekiMall dalam Program Pembeli Get Pembeli hingga kedalaman 5 Generasi sehingga dari setiap pembelian referensi Anda tersebut Anda akan memperoleh bonus dengan total 0,9%</p><p>Anda dapat mempromosikan link referal Anda dengan format www.rejekimall.com/username_anda<br />System di RejekiMall mengunci dengan cookies selama 10 hari link referal Anda tersebut.</p><p>Selamat bertransaksi,<br />Terima kasih</p>', '2015-02-20', 'AKTIF', 'pembeli'),
(2, 'Link Referal Penjual Get Penjual', '<p>RejekiMall menyediakan kesempatan bagi Anda untuk mereferensikan saudara/sahabat/teman/relasi Anda untuk menjadi Penjual di RejekiMall dalam Program Penjual Get Penjual hingga kedalaman 5 Generasi sehingga dari omzet penjualan referensi Anda tersebut Anda akan memperoleh bonus dengan total 0,9%</p><p>Anda dapat mempromosikan link referal Anda dengan format www.rejekimall.com/username_anda<br />System di RejekiMall mengunci dengan cookies selama 10 hari link referal Anda tersebut.</p><p>Selamat bertransaksi,<br />Terima kasih</p>', '2015-02-20', 'AKTIF', 'penjual');
